import { Typography } from "@mui/material";
import React from "react";

const Result = ({ isCorrect }) => {
  if (isCorrect) {
    return <Typography>Correct!</Typography>;
  } else if (!isCorrect) {
    return <Typography>Wrong</Typography>;
  }
};

export default Result;
